import{_ as e,o as t,c as a,O as o}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 58.1-3343 Effect of lien on certain real estate jointly owned.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/58.1-3343.md","filePath":"vacode/58.1-3343.md"}'),n={name:"vacode/58.1-3343.md"},r=o('<h1 id="§-58-1-3343-effect-of-lien-on-certain-real-estate-jointly-owned" tabindex="-1">§ 58.1-3343 Effect of lien on certain real estate jointly owned. <a class="header-anchor" href="#§-58-1-3343-effect-of-lien-on-certain-real-estate-jointly-owned" aria-label="Permalink to &quot;§ 58.1-3343 Effect of lien on certain real estate jointly owned.&quot;">​</a></h1><p>The lien on real estate owned by more than one person as tenants in common, joint tenants or otherwise for the payment of all prior, present and subsequent taxes and levies or assessments thereof, including any tax, levy, or assessment authorized under § <a href="/vacode/58.1-3712/">58.1-3712</a>, <a href="/vacode/58.1-3713/">58.1-3713</a>, <a href="/vacode/58.1-3713.4/">58.1-3713.4</a>, or <a href="/vacode/58.1-3741/">58.1-3741</a>, shall not be impaired if such real estate was or is assessed in the name of one of such owners with the notation &quot;and another,&quot; or &quot;and others,&quot; or &quot;and wife,&quot; or &quot;and husband,&quot; or &quot;and spouse,&quot; or the appropriate abbreviations of such words, or their legal equivalents, so as to indicate that the real estate was or is owned by more than one person.</p><p>Code 1950, § 58-770; 1984, c. 675; 2001, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0462" target="_blank" rel="noreferrer">462</a>; 2013, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?131+ful+CHAP0305" target="_blank" rel="noreferrer">305</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?131+ful+CHAP0618" target="_blank" rel="noreferrer">618</a>; 2020, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0900" target="_blank" rel="noreferrer">900</a>.</p>',3),i=[r];function s(l,c,f,d,h,p){return t(),a("div",null,i)}const g=e(n,[["render",s]]);export{u as __pageData,g as default};
